import React from 'react'
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import Avatar from './headerItems/avatar'
import ProfileDetails from './headerItems/profileDetails';

const headerContainer = () => {
    const style = {
        container: {
            padding: '0px',
            backgroundColor: 'rgb(223, 241, 255)', 
            height: '30vh', 
            display:'flex',
            justifyContent:'center', 
            alignItems:'center'
        }
    }
    return (
        <React.Fragment>
            <CssBaseline />
            <Container maxWidth="lg" style ={style.container}>
                <Avatar />
                <ProfileDetails />

            </Container>
        </React.Fragment>
    )
}

export default headerContainer
